import React, { useState } from 'react'

const fetch = () => {
  fetch('https://api.chucknorris.io/jokes/search?query=god')
    .then(response => {
      return response.json()
    })
    .then(data => {
      return data
    })
    .catch(err => {
      console.log(err)
    })
}

const App = () => {
  const [clock, setClock] = useState("Pas d'horaire")

  return (
    <div className="App">
      <h1>Clock</h1>
      <span>{clock}</span>
    </div>
  )
}

export default App
